Male Tergum X membranous (
Fig. 51
). Superior appendages laterally compressed; in lateral view robust, sub-rectangular, length about 3 times width (
Fig. 49
); in dorsal view, slender, length about 6 times width, with several small processes on mesal margin subapically and one in basal half (
Fig. 51
). Phallus simple, tube-like, dilated slightly distally, with pairs of spines apically, embedded subapically and a pair of slender hooked processes dorsally; with a single, down-curved process (phallic guide) arising from near the base of the inferior appendages (
Fig. 49
). Inferior appendages robust, dorso-ventrally flattened; in ventral view fused in basal fifth to form a single plate, distal four fifths separated narrowly by a deep mesal split, with pair of relatively narrow apices (
Fig. 50
); in lateral view robust, length about 3 times width, broadest basally, tapered gradually distally (
Fig. 49
).

Female. Genitalia with a pair of large, semi-ovoid, narrowly separated ‘tongue-shaped’ lobes on sternite VIII (
Fig. 61
).
